  [self.request requestWithApiName:@"tuya.m.country.list" postData:nil version:@"1.0" success:^(id result) {

  } failure:^(NSError *error) {

  }];

}

Attention
TuyaSmartRequest instance should be retained, otherwise, the local object will be released, api request will be canceled, and response with following error:
Error Domain=NSURLErrorDomain Code=-999 "Canceled"
See: ARC Memory Management - Apple Developer Documentation
Merge interface
Merge multiple api request to one request.
Usage:
Subclass TYApiMergeService, then add the requests you want to merge and send.
Example:
  // @property (nonatomic, strong) ExampleMergeRequest *service;

  _service = [[ExampleMergeRequest alloc] init];
  [_service loadHomeDataWithHomeId:homeId success:^(NSArray *list) {

  } failure:^(NSError *error) {

  }];

ExampleMergeRequest.h
#import 

@interface ExampleMergeRequest : TYApiMergeService

- (void)loadHomeDataWithHomeId:(long long)homeId success:(void (^)(NSArray  *list))success failure:(TYFailureError)failure;

@end

ExampleMergeRequest.m
#import "ExampleMergeRequest.h"

@implementation ExampleMergeRequest

- (void)loadHomeDataWithHomeId:(long long)homeId success:(void (^)(NSArray  *list))success failure:(TYFailureError)failure {

  self.requestList = [NSMutableArray array];

  [self addApiRequest:@"tuya.m.my.group.mesh.list" postData:@{} version:@"1.0"];
  [self addApiRequest:@"tuya.m.location.get" postData:@{@"gid": @(homeId)} version:@"2.0"];

  [self sendRequest:@{@"gid": @(homeId)} success:success failure:failure];
}

@end

resource/Push.html.body:
Integrate push
For Apps developed by using the Tuya SDK, the Tuya platform supports push function, sending operation push to users and alarm push of products. 
Configure Xcode
Clock project -> TARGETS -> Capabilities, and switch on the Push Notification switch. The effect is as follows.

Configure the Tuya Developer Platform
Log in to the Tuya Developer Platform -> enter relevant App ->Configure the Push function->Upload the push certificate.

Initialization
Initiate push in the didFinishLaunchingWithOptions method. 

- (BOOL)application:(UIApplication *)application didFinishLaunchingWithOptions:(NSDictionary *)launchOptions {


    [application registerForRemoteNotifications];
    [application registerUserNotificationSettings:[UIUserNotificationSettings settingsForTypes:UIUserNotificationTypeAlert|UIUserNotificationTypeBadge|UIUserNotificationTypeSound categories:nil]];


    if ([[[UIDevice currentDevice] systemVersion] floatValue] >= 10.0) {
        //iOS10需要加下面这段代码。
        UNUserNotificationCenter *center = [UNUserNotificationCenter currentNotificationCenter];
        center.delegate = self;
        UNAuthorizationOptions types10 = UNAuthorizationOptionBadge|UNAuthorizationOptionAlert|UNAuthorizationOptionSound;
        [center requestAuthorizationWithOptions:types10 completionHandler:^(BOOL granted, NSError * _Nullable error) {
            if (granted) {
                //点击允许
            } else {
                //点击不允许
            }
        }];
    }

}

Register pushId
Register pushId in Tuya SDK in the didRegisterForRemoteNotificationsWithDeviceToken. 

- (void)application:(UIApplication *)application didRegisterForRemoteNotificationsWithDeviceToken:(NSData *)deviceToken {


    NSString *pushId = [[[[deviceToken description]
                 stringByReplacingOccurrencesOfString:@" " withString:@""]
                stringByReplacingOccurrencesOfString:@"" withString:@""];

    NSLog(@"pushId is %@",pushId);

    [[TuyaSmartSDK sharedInstance] setValue:pushId forKey:@"deviceToken"];
}

Receive notification
Execute in the delegate method didReceiveRemoteNotification when the remote notification is received. 
- (void)application:(UIApplication *)application didReceiveRemoteNotification:(NSDictionary *)userInfo fetchCompletionHandler:(void(^)(UIBackgroundFetchResult))completionHandler {


}

Send push
Add operation push
Tuya Developer Platform -> User operation -> Message center ->Add message

Add alarm push
Tuya Developer Platform -> Product -> Extended function ->Set alarm -> Add rules for alarms (apply the push mode)
